import React, { useEffect, useRef } from 'react';
// import RelationGraph from 'relation-graph/react';
import RelationGraph from '../relation-graph-agent';
import type { MutableRefObject} from 'react';
import type {
  RGJsonData,
  RGLine,
  RGLink,
  RGNode,
  RGOptions,
  RelationGraphExpose
} from '../relation-graph-agent';
const NodeSvgMenu: React.FC = () => {
  return (
    <img width="160px" height="160px"  src="data:img/png;base64," />
  );
};
const RGClock: React.FC = () => {
  const graphRef = useRef() as MutableRefObject<RelationGraphExpose>;
  useEffect(() => {
    const graphJsonData:RGJsonData = {
      rootId: 'root',
      nodes: [
        { id: 'root', text: '', width: 100, height: 100, data: {percent:0} }
      ],
      lines: [],
    };
    for (let i=1;i<18;i++) {
      graphJsonData.nodes.push({ id: i.toString(), text: i.toString() });
      graphJsonData.lines.push({ from: 'root', to: i.toString(), text: 'Text' });
    }
    graphRef.current.setJsonData(graphJsonData,  true,() => {
    });
  }, []);
  const options:RGOptions = {
    debug: true,
    showDebugPanel: true,
    lineUseTextPath: true,
    defaultLineShape: 1,
    placeSingleNode: false,
    moveToCenterWhenRefresh: true,
    zoomToFitWhenRefresh: true,
    // disableLineClickEffect: true,
    layouts: [
      {
        layoutName: 'center',
        maxLayoutTimes: 3000
      }
    ],
    defaultNodeBorderWidth: 0,
    defaultNodeColor: '#42ad18'
  };
  const onNodeClick = (node: RGNode, _e: MouseEvent | TouchEvent) => {
    console.log('onNodeClick:', node.text);
    return true;
  };
  const onLineClick = (line: RGLine, _link: RGLink, _e: MouseEvent | TouchEvent) => {
    console.log('onLineClick:', line.text, line.from, line.to);
    return true;
  };
  return <div>
    <div style={{ height: 600, width: 900, border: '#efefef solid 1px' }}>
      <RelationGraph ref={graphRef} options={options} onNodeClick={onNodeClick} onLineClick={onLineClick} />
      <NodeSvgMenu />
    </div>
  </div>;
};
export default RGClock;
